import {
    Nav,
    NavLink,
    Bars,
    NavMenu,
    NavBtn,
    NavBtnLink
  } from './NavbarElement';
function Navbar() {
    return (
        <Nav>
            <NavLink to='/'>
                Shopping cart
            </NavLink>
            <Bars />
          <NavLink to='/about' activeStyle>
          {props.countCartItems ? (
            <button className="badge">{props.countCartItems}</button>
          ) : (
            ''
          )}
          </NavLink>
        </Nav>
    )
}

export default Navbar
